import React from "react";

function Header(props) {
    return <div className="jumbotron text-center">
      <h1 className="te">Good Memory Everyone!</h1>
      <h3>...Now what was I talking about?</h3>
      <div className="row">

      <div className="col-md-6"><h2>Score: {props.score} </h2></div>
      <div className="col-md-6"><h2>High Score: {props.highScore}</h2> </div>
      </div>

  </div>
}

export default Header;
